// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract RentalAgreement {
    address payable public landlord;
    address payable public renter;
    uint256 public securityDeposit;
    uint256 public baseRent;
    uint256 public rentingPeriodMonths;
    uint256 public rentStartDate;
    uint256 public currentRentedPeriod;
    uint256 public rentDue;
    bool public rentStopped;
    
    enum DamageReportStatus { None, LandlordReported, RenterDisputed, Resolved }
    DamageReportStatus public damageStatus;
    uint256 public reportedDamageAmount;

    event RentPaid(uint256 amount, uint256 rentedPeriod);
    event DamageReported(address reporter, uint256 amount);
    event ContractClosed(uint256 finalSecurityAmount);

    modifier onlyLandlord() {
        require(msg.sender == landlord, "Only landlord can call this function");
        _;
    }

    modifier onlyRenter() {
        require(msg.sender == renter, "Only renter can call this function");
        _;
    }

    modifier rentNotStopped() {
        require(!rentStopped, "Rent has already stopped");
        _;
    }

    constructor(address payable _renter, uint256 _baseRent, uint256 _rentingPeriodMonths) {
        landlord = payable(msg.sender);
        renter = _renter;
        baseRent = _baseRent;
        rentingPeriodMonths = _rentingPeriodMonths;
        rentStartDate = block.timestamp;
        currentRentedPeriod = 0;
        rentDue = 0;
        rentStopped = false;
    }

    function paySecurityDeposit() external payable onlyRenter {
        require(securityDeposit == 0, "Security deposit already paid");
        securityDeposit = msg.value;
    }

    function payRent(uint256 _utilities) external payable onlyRenter rentNotStopped {
        uint256 totalRent = baseRent + _utilities + rentDue;
        require(msg.value >= totalRent, "Insufficient rent payment");
        
        rentDue = 0;
        currentRentedPeriod++;
        
        if (msg.value > totalRent) {
            payable(msg.sender).transfer(msg.value - totalRent);
        }
        
        landlord.transfer(totalRent);
        
        emit RentPaid(totalRent, currentRentedPeriod);
        
        if (currentRentedPeriod >= rentingPeriodMonths) {
            rentStopped = true;
        }
    }

    function reportDamage(uint256 _damageAmount) external {
        require(rentStopped, "Rent must be stopped to report damage");
        require(damageStatus == DamageReportStatus.None, "Damage already reported");
        
        if (msg.sender == landlord) {
            damageStatus = DamageReportStatus.LandlordReported;
        } else if (msg.sender == renter) {
            damageStatus = DamageReportStatus.RenterDisputed;
        } else {
            revert("Only landlord or renter can report damage");
        }
        
        reportedDamageAmount = _damageAmount;
        emit DamageReported(msg.sender, _damageAmount);
    }

    function acceptDamageEstimation() external {
        require(rentStopped, "Rent must be stopped to accept damage estimation");
        require(damageStatus != DamageReportStatus.None, "No damage reported yet");
        require(damageStatus != DamageReportStatus.Resolved, "Damage estimation already resolved");
        
        if (msg.sender == renter && damageStatus == DamageReportStatus.LandlordReported) {
            damageStatus = DamageReportStatus.Resolved;
        } else if (msg.sender == landlord && damageStatus == DamageReportStatus.RenterDisputed) {
            damageStatus = DamageReportStatus.Resolved;
        } else {
            revert("Invalid acceptance");
        }
    }

    function closeContract() external {
        require(rentStopped, "Rent must be stopped to close the contract");
        require(damageStatus == DamageReportStatus.Resolved || damageStatus == DamageReportStatus.None, "Damage dispute not resolved");
        
        uint256 finalSecurityAmount = securityDeposit - reportedDamageAmount;
        renter.transfer(finalSecurityAmount);
        
        emit ContractClosed(finalSecurityAmount);
    }
}

